  false,\n\t\"url\": null,\n\t\"notes\": \"This narrative report for Necedah NWR outlines
  Refuge accomplishments from May through August of 1962. The report begins by summarizing
  the weather conditions, habitat conditions, water conditions, and food and cover
  during this period. Wildlife- including migratory birds, upland game birds, big
  game animals, furbearers, predators, rodents, mammals, raptors, reptiles, and fish-
  is also covered. The Refuge development and maintenance section discusses physical
  developments, plantings, collections and receipts, vegetation control, and wildfires.
  Resource management is outlined; topics include grazing, haying, and timber removal.
  A progress report on field investigations and applied research is also provided.
  The public relations section of the report describes recreational uses, Refuge visitors,
  Refuge participation, and safety. Items of interest, N-R forms, and photographs
  are attached.\",\n\t\"license_title\": \"License Not Specified\",\n\t\"extras\":
